                    <span className="home__title">hiMath Gaming</span>
                    <span className="home__subtitle">Revolutionize Learning</span>
                </div>
                <div className="content__body">
                    <div id="carouselExampleFade" className="carousel slide carousel-fade" data-ride="carousel">
                        <div className="carousel-inner">
                            <div className="carousel-item active">
                                <img src="https://image.freepik.com/free-photo/abstract-luxury-clear-yellow-wall-well-use-as-backdrop-background-layout_1258-207.jpg" className="d-block w-100" alt="..."/>
                            </div>
