                            </div>
                            <div className="carousel-item">
                                <img src="https://image.freepik.com/free-photo/abstract-pink-red-background-christmas-valentines-layout-des_1258-262.jpg" className="d-block w-100" alt="..."/>
                            </div>
                        </div>
                        {/*<a className="carousel-control-prev" href="#carouselExampleFade" role="button"*/}
                        {/*   data-slide="prev">*/}
                        {/*    <span className="carousel-control-prev-icon" aria-hidden="true"></span>*/}
                        {/*    <span className="sr-only">Previous</span>*/}
                        {/*</a>*/}
                        {/*<a className="carousel-control-next" href="#carouselExampleFade" role="button"*/}
                        {/*   data-slide="next">*/}
                        {/*    <span className="carousel-control-next-icon" aria-hidden="true"></span>*/}
                        {/*    <span className="sr-only">Next</span>*/}
                        {/*</a>*/}
                    </div>

                </div>
            </div>
        </div>
    </React.Fragment>
}

export default Home;
